kxsazpackage Lec112ndFeb;

public class SwappingFunc {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a =12;
		int b =13;
		System.out.println("Before Swap 9" + a + " " + b);
		int temp = a;
		a = b;
		b = temp;
		System.out.println("After Swap " + a + " " + b);

	}

}
